import React, { useState } from 'react';

const AIFinancialAnalysis = ({ expenses = [], savings = [] }) => {
  const [aiInsights, setAiInsights] = useState(null);
  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState(null);

  const fetchAIAnalysis = async () => {
    setIsLoading(true);
    setError(null);

    // Procesar datos de gastos
    const formattedExpenses = expenses.map(exp => ({
      amount: parseFloat(exp.amount),
      category: exp.category,
      description: exp.description,
      date: exp.date
    }));

    // Procesar datos de ahorros
    const formattedSavings = savings.map(sav => ({
      amount: parseFloat(sav.target_amount),
      current: parseFloat(sav.current_amount),
      name: sav.goal_name,
      date: sav.target_date
    }));

    // Calcular totales
    const totalExpenses = formattedExpenses.reduce((sum, exp) => sum + exp.amount, 0);
    const totalSavings = formattedSavings.reduce((sum, sav) => sum + sav.current, 0);
    const categories = [...new Set(formattedExpenses.map(exp => exp.category))];

    try {
      const response = await fetch('http://localhost:11434/api/generate', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          model: 'llama3.2:3b-instruct-q8_0',
          prompt: 'Retorna solo el siguiente JSON:\n' +
            '{\n' +
            `  "gastosTotales": ${totalExpenses},\n` +
            `  "ahorrosTotales": ${totalSavings},\n` +
            '  "analisisGastos": "El análisis de tus gastos muestra: ' + 
            formattedExpenses.map(e => `${e.category}: ${e.amount}€`).join(', ') + '",\n' +
            '  "progresoAhorros": "Tu progreso en ahorros es: ' + 
            formattedSavings.map(s => `${s.name}: ${s.current}€ de ${s.amount}€`).join(', ') + '",\n' +
            '  "recomendaciones": [\n' +
            '    "Revisa tus gastos en ' + categories.join(', ') + '",\n' +
            '    "Considera aumentar tus ahorros mensuales",\n' +
            '    "Establece un presupuesto para cada categoría"\n' +
            '  ],\n' +
            `  "categoriasMayorGasto": ${JSON.stringify(categories)},\n` +
            `  "potencialAhorro": ${totalExpenses * 0.2}\n` +
            '}'
        })
      });

      const data = await response.json();
      console.log('Respuesta del modelo:', data.response);

      // Extraer el JSON de la respuesta
      const jsonMatch = data.response.match(/\{[\s\S]*\}/);
      if (!jsonMatch) {
        throw new Error('No se encontró un JSON válido en la respuesta');
      }

      const jsonStr = jsonMatch[0];
      console.log('JSON extraído:', jsonStr);
      const jsonObject = JSON.parse(jsonStr);
      setAiInsights(jsonObject);
    } catch (error) {
      console.error('Error completo:', error);
      setError('Error al procesar el análisis. Por favor, intenta de nuevo.');
    }

    setIsLoading(false);
  };

  const buttonStyle = isLoading 
    ? "w-full py-2 px-4 rounded-lg text-white bg-gray-400" 
    : "w-full py-2 px-4 rounded-lg text-white bg-blue-600 hover:bg-blue-700";

  return (
    <div className="p-4 space-y-4">
      <button
        onClick={fetchAIAnalysis}
        disabled={isLoading}
        className={buttonStyle}
      >
        {isLoading ? "Analizando..." : "Obtener Análisis"}
      </button>

      {error && (
        <div className="p-3 bg-red-50 border border-red-200 rounded-lg text-red-700">
          {error}
        </div>
      )}

      {aiInsights && (
        <div className="space-y-4">
          <div className="grid grid-cols-2 gap-4">
            <div className="p-3 bg-blue-50 rounded-lg">
              <p className="text-sm text-blue-600">Gastos Totales</p>
              <p className="text-xl font-bold">
                {parseFloat(aiInsights.gastosTotales).toLocaleString('es-ES', {
                  style: 'currency',
                  currency: 'EUR'
                })}
              </p>
            </div>
            <div className="p-3 bg-green-50 rounded-lg">
              <p className="text-sm text-green-600">Ahorros Totales</p>
              <p className="text-xl font-bold">
                {parseFloat(aiInsights.ahorrosTotales).toLocaleString('es-ES', {
                  style: 'currency',
                  currency: 'EUR'
                })}
              </p>
            </div>
          </div>

          <div className="space-y-3">
            <div>
              <h3 className="font-medium">Análisis de Gastos</h3>
              <p>{aiInsights.analisisGastos}</p>
            </div>

            <div>
              <h3 className="font-medium">Progreso de Ahorros</h3>
              <p>{aiInsights.progresoAhorros}</p>
            </div>

            <div>
              <h3 className="font-medium">Categorías con Mayor Gasto</h3>
              <div className="flex gap-2 flex-wrap">
                {aiInsights.categoriasMayorGasto.map((cat, index) => (
                  <span key={index} className="px-2 py-1 bg-gray-100 rounded-full text-sm">
                    {cat}
                  </span>
                ))}
              </div>
            </div>

            <div>
              <h3 className="font-medium">Recomendaciones</h3>
              <ul className="list-disc list-inside">
                {aiInsights.recomendaciones.map((rec, index) => (
                  <li key={index}>{rec}</li>
                ))}
              </ul>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default AIFinancialAnalysis;
